class LldpXMedDeviceClass(TextualConvention, Integer32):
    description = 'Device Class to which the device is a member. A value of notDefined(0) indicates that the device has capabilities not covered by any of the LLDP-MED classes. A value of endpointClass1(1) indicates that the device has endpoint class 1 capabilities. A value of endpointClass2(2) indicates that the device has endpoint class 2 capabilities. A value of endpointClass3(3) indicates that the device has endpoint class 3 capabilities. A value of networkConnectivity(4) indicates that the device has network connectivity device capabilities. '
