class LldpXMedCapabilities(TextualConvention, Bits):
    description = "Bitmap that includes the MED organizationally defined set of LLDP TLVs the device is capable of and whose transmission is allowed on the local LLDP agent by network management. Each bit in the bitmap corresponds to an LLDP-MED subtype associated with a specific TIA TR41.4 MED TLV. Having the bit 'capabilities(0)' set indicates that the LLDP agent refers to the Capabilities TLVs. Having the bit 'networkPolicy(1)' set indicates that the LLDP agent refers to the Network Policy TLVs. Having the bit 'location(2)' set indicates that the LLDP agent refers to the Emergency Communications System Location TLVs. Having the bit 'extendedPSE(3)' set indicates that the LLDP agent refers to the Extended PoE TLVs with PSE capabilities. Having the bit 'extendedPD(4)' set indicates that the LLDP agent refers to the Extended PoE TLVs with PD capabilities. Having the bit 'inventory(5)' set indicates that the LLDP agent refers to the Hardware Revision, Firmware Revision, Software Revision, Serial Number, Manufacturer Name, Model Name, and Asset ID TLVs."
    status = 'current'
    namedValues = NamedValues(("capabilities", 0), ("networkPolicy", 1), ("location", 2), ("extendedPSE", 3), ("extendedPD", 4), ("inventory", 5))

class LocationSubtype(TextualConvention, Integer32):
    description = 'The location subtype advertised by the remote endpoint. A value coordinateBased(2) indicates that the location subtype advertised by the endpoint is defined to use the relevant sub- fields of the DHCP option for Coordinate LCI as specified in ANSI/TIA-1057, Section 10.2.4.3.1. A value civicAddress(3) indicates that the location subtype advertised by the endpoint is defined to use the relevant sub- fields of the DHCP option for Civic Address as specified in ANSI/TIA-1057, Section 10.2.4.3.2. A value elin(4) indicates that the location subtype advertised by the endpoint is defined to use the Emergency Location Information Number (ELIN) as specified in ANSI/TIA-1057, Section 10.2.4.3.3.'
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))
    namedValues = NamedValues(("unknown", 1), ("coordinateBased", 2), ("civicAddress", 3), ("elin", 4))

class PolicyAppType(TextualConvention, Bits):
    description = 'The media type that defines the primary function of the application for the policy advertised by an endpoint. Having the bit voice(1) set indicates that the media type defining a primary function of the application for the policy advertised on the local port is voice. Having the bit voiceSignaling(3) set indicates that the media type defining a primary function of the application for the policy advertised on the local port is voice signaling. Having the bit guestVoice(4) set indicates that the media type Defining a primary function of the application for the policy advertised on the local port is guest voice. Having the bit guestVoiceSignaling(5) set indicates that the media type defining a primary function of the application for the policy advertised on the local port is guest voice signaling. Having the bit softPhoneVoice(6) set indicates that the media type Defining a primary function of the application for the policy advertised on the local port is softphone voice. Having the bit videoConferencing(7) set indicates that the media type defining a primary function of the application for the policy advertised on the local port is voice. Having the bit streamingVideo(8) set indicates that the media type defining a primary function of the application for the policy advertised on the local port is streaming video. Having the bit videoSignaling(2) set indicates that the media type defining a primary function of the application for the policy advertised on the local port is video signaling.'
    status = 'current'
    namedValues = NamedValues(("unknown", 0), ("voice", 1), ("voiceSignaling", 2), ("guestVoice", 3), ("guestVoiceSignaling", 4), ("softPhoneVoice", 5), ("videoconferencing", 6), ("streamingVideo", 7), ("videoSignaling", 8))

